oxy_webhelp_navlinks = {"amazon_s3-d22872e13885":{"topics":[{"title":"Amazon S3 inventory management","shortdesc":"<p class=\"shortdesc\">Amazon S3 inventory management involves the following actions, which can be performed         from the AWS S3 inventory page: viewing all the Amazon S3 buckets associated with all your         AWS accounts, managing protection policies for S3 buckets, taking on-demand snapshots,         creating tag-based rules, and performing recovery operations on the S3 backups from the         specific S3 bucket snapshot page.<\/p>","href":"amazon_S3\/amazon_s3_inventory_management.html","attributes":{"data-id":"amazon_s3_inventory_management"},"menu":{"hasChildren":false},"tocID":"amazon_s3_inventory_management-d22872e13899","next":"amazon_s3_inventory_management-d22872e13899"},{"title":"Large Amazon S3 buckets protection","shortdesc":"<p class=\"shortdesc\">With <span class=\"ph\">RSC<\/span>, you can protect Amazon S3 buckets with up to one billion         objects.<\/p>","href":"saas\/aws_protect_large_s3_buckets.html","attributes":{"data-id":"aws_protect_large_s3_buckets"},"menu":{"hasChildren":false},"tocID":"aws_protect_large_s3_buckets-d22872e13932","topics":[]},{"title":"Anomaly Detection for Amazon S3 buckets","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Anomaly Detection<\/span> for your Amazon S3 buckets identifies and analyzes anomaly         events that can indicate a ransomware attack and provides data recovery services on         protected resources.<\/p>","href":"amazon_S3\/anomaly_detection_amazon_s3_buckets.html","attributes":{"data-id":"anomaly_detection_amazon_s3_buckets"},"menu":{"hasChildren":false},"tocID":"anomaly_detection_amazon_s3_buckets-d22872e13946","topics":[]}]}};